import React from "react";
import { Section } from "./Section";
import "../css/hero.css";
import "../css/section.css";

// ...existing code...

export default function Hero() {
  return (
    <Section className="hero-section">
  <div className="hero-orb" />
  <h1 className="hero-title">Software Engineer · Full-Stack</h1>
  <hr className="hero-bar" />
  <p className="hero-text">
      Passionate about AI and computer science, I create solutions to improve daily life and aim to found my own company. Interested in AI innovation? Let’s connect!
      </p>

      <div className="hero-row">
        {["React", "TypeScript", "Python", "AWS", "CI/CD", "DX"].map((t) => (
          <span key={t} className="hero-pill">{t}</span>
        ))}
      </div>

 <div className="hero-row" style={{ marginTop: 22, display: "flex", gap: 12 }}>
  <a
    href="https://github.com/SenluoChen"
    target="_blank"
    rel="noreferrer"
    style={{ textDecoration: "none" }}
  >
    <button
      className="hero-primary-btn"
      style={{
        display: "flex",
        alignItems: "center",
        gap: 8,
        padding: "10px 18px",
        borderRadius: 12,
        border: "1px solid rgba(148,163,184,0.25)",
        background:
          "linear-gradient(180deg,#0b1220 0%, #0f1b2f 100%)",
        color: "#e5e7eb",
        fontWeight: 600,
        fontSize: 15,
        cursor: "pointer",
        transition: "all .2s ease",
      }}
      onMouseEnter={(e) => {
        e.currentTarget.style.borderColor = "#38bdf8";
        e.currentTarget.style.boxShadow =
          "0 4px 16px rgba(56,189,248,0.25)";
        e.currentTarget.style.transform = "translateY(-2px)";
      }}
      onMouseLeave={(e) => {
        e.currentTarget.style.borderColor = "rgba(148,163,184,0.25)";
        e.currentTarget.style.boxShadow = "none";
        e.currentTarget.style.transform = "translateY(0)";
      }}
    >
      <svg
        width="18"
        height="18"
        fill="currentColor"
        viewBox="0 0 24 24"
      >
        <path d="M12 .5C5.65.5.5 5.65.5 12c0 5.1 3.3 9.4 7.9 10.9.6.1.8-.3.8-.6v-2.1c-3.2.7-3.9-1.5-3.9-1.5-.5-1.1-1.2-1.4-1.2-1.4-1-.7.1-.7.1-.7 1.1.1 1.7 1.2 1.7 1.2 1 .1.6 1.5.6 1.5.9 1.5 2.5 1 3.1.8.1-.7.4-1.1.7-1.4-2.6-.3-5.3-1.3-5.3-5.9 0-1.3.5-2.4 1.2-3.3-.1-.3-.5-1.5.1-3.1 0 0 1-.3 3.3 1.2a11.4 11.4 0 016 0c2.3-1.5 3.3-1.2 3.3-1.2.6 1.6.2 2.8.1 3.1.8.9 1.2 2 1.2 3.3 0 4.6-2.7 5.6-5.3 5.9.4.3.7.9.7 1.7v2.5c0 .3.2.7.8.6 4.6-1.6 7.9-5.8 7.9-10.9C23.5 5.65 18.35.5 12 .5z" />
      </svg>
      GitHub
    </button>
  </a>

  <a
    href="https://www.behance.net/"
    target="_blank"
    rel="noreferrer"
    style={{ textDecoration: "none" }}
  >
    <button
      className="hero-primary-btn"
      style={{
        display: "flex",
        alignItems: "center",
        gap: 8,
        padding: "10px 18px",
        borderRadius: 12,
        border: "1px solid rgba(148,163,184,0.25)",
        background:
          "linear-gradient(180deg,#0b1220 0%, #0f1b2f 100%)",
        color: "#e5e7eb",
        fontWeight: 600,
        fontSize: 15,
        cursor: "pointer",
        transition: "all .2s ease",
      }}
      onMouseEnter={(e) => {
        e.currentTarget.style.borderColor = "#0ea5e9";
        e.currentTarget.style.boxShadow =
          "0 4px 16px rgba(14,165,233,0.25)";
        e.currentTarget.style.transform = "translateY(-2px)";
      }}
      onMouseLeave={(e) => {
        e.currentTarget.style.borderColor = "rgba(148,163,184,0.25)";
        e.currentTarget.style.boxShadow = "none";
        e.currentTarget.style.transform = "translateY(0)";
      }}
    >
      <svg
        width="18"
        height="18"
        fill="currentColor"
        viewBox="0 0 24 24"
      >
        <path d="M4 3h16a1 1 0 011 1v16a1 1 0 01-1 1H4a1 1 0 01-1-1V4a1 1 0 011-1zm5.3 11.8c1 0 2.1-.6 2.5-1.4.4-.9.4-2 .1-2.9-.3-.9-1-1.5-2-1.7h-2v6h1.4zm-.9-8.3h3.2c1.4 0 2.6.5 3.2 1.9.6 1.3.6 2.7 0 3.9-.6 1.2-1.7 1.9-3.1 1.9H8.4V6.5zm7.9 0h2.9v1.3h-2.9V6.5zm0 2.1h2.7v1.2h-2.7V8.6zm0 2.2h3v1.3h-3v-1.3zm0 2.2h3.3v1.3h-3.3v-1.3z" />
      </svg>
      Behance
    </button>
  </a>
</div>

    </Section>
  );
}
